import './friends.css'

function Friends({u}) {
    return (
        <li className="leftbarFriend">
                <img src={u.profilePicture} alt="friend profile pic" className="leftbarFriendImg" />
                <span className="leftbarFriendName">{u.username}</span>
        </li>
    )
}

export default Friends
